      out.write("                                                                                                                            <p class=\"title\">Coins</p>\n");
      out.write("                                                                        \n");
      out.write("                                                                                                                            <p class=\"desc\">A coin is a piece of hard material that is standardized in weight, is produced in large quantities in order to facilitate trade, and primarily can be used as a legal tender. Coins are usually metal or a metallic material and sometimes made of synthetic materials, usually in the shape of a disc, and most often issued by a\n");
      out.write("                                                                                                                                government. Coins are used as a form of money in transactions of various kinds, from the everyday circulation coins to the storage of large numbers of bullion coins. In the present day, coins and banknotes make up currency, the cash forms of all modern money systems.</p>\n");
