      out.write("                                                                                                                            <p class=\"title\">Flower</p>\n");
      out.write("                                                                        \n");
      out.write("                                                                                                                            <p class=\"desc\">A flower, sometimes known as a bloom or blossom, is the reproductive structure found in flowering plants (plants of the division Magnoliophyta, also called angiosperms). The biological function of a flower is to effect reproduction, usually by providing a mechanism for the union of sperm with eggs. Flowers may facilitate\n");
      out.write("                                                                                                                                outcrossing (fusion of sperm and eggs from different individuals in a population) or allow selfing (fusion of sperm and egg from the same flower).</p>\n");
