      out.write("                                                                        \n");
      out.write("                                                                                                                            <p class=\"desc\">A pseudanthium (Greek for \"false flower\") or flower head is a special type of inflorescence, in which several flowers are grouped together to form a flower-like structure. The real flowers are generally small and greatly reduced, but can sometimes be quite large (as in the sunflower flower head). Pseudanthia take various forms.\n");
      out.write("                                                                                                                                The individual flowers of a pseudanthium can be called florets.</p>\n");
