      out.write("                                                                                                                            <p class=\"title\">Flowering Plant</p>\n");
      out.write("                                                                        \n");
      out.write("                                                                                                                            <p class=\"desc\">The flowering plants (angiosperms), also known as Angiospermae or Magnoliophyta, are the most diverse group of land plants. Angiosperms are seed-producing plants like the gymnosperms and can be distinguished from the gymnosperms by a series of synapomorphies (derived characteristics). These characteristics include flowers,\n");
      out.write("                                                                                                                                endosperm within the seeds, and the production of fruits that contain the seeds.</p>\n");
